var courseSidebar = $('.course-sidebar');
var footer = $('.footer');
var related = $('.related_courses ');
var courseHeader = $('.inner-header');
var businessAssociates = $('.business__associates');
var margin = 160;

if($('div').hasClass('course-sidebar')){
    var offsetTop = courseSidebar.offset().top + ( 193 - margin);
}



function checkWindowWidth(MqL) {
//check window width (scrollbar included)
    var e = window,
        a = 'inner';
    if (!('innerWidth' in window )) {
        a = 'client';
        e = document.documentElement || document.body;
    }
    if ( e[ a+'Width' ] >= MqL ) {
        return true;
    } else {
        return false;
    }
}

$(window).scroll(function () {

    if(checkWindowWidth(1200)){
        var scrollTop = $(window).scrollTop();
        var offsetBottom = footer.offset().top - ( margin*2 + courseSidebar.height()+related.height()+businessAssociates.height());
        if (scrollTop > offsetTop && courseSidebar.hasClass('natural')) {
            courseSidebar.removeClass('natural').addClass('fixed').css('top', margin);
            courseHeader.clone().addClass('duplicated').insertAfter(".course-header-area");
        }
        if (offsetTop > scrollTop && courseSidebar.hasClass('fixed')) {
            courseSidebar.removeClass('fixed').addClass('natural').css('top', 'auto');
            $(".course-header-area.duplicated").remove();
        }
        if (scrollTop > offsetBottom && courseSidebar.hasClass('fixed')) {
            courseSidebar.removeClass('fixed').addClass('bottom').css('top', (offsetBottom) - (related.height()));
        }
        if (offsetBottom > scrollTop && courseSidebar.hasClass('bottom')) {
            courseSidebar.removeClass('bottom').addClass('fixed').css('top', margin);
        }
    }

});



